// SPDX-License-Identifier: MIT

pragma solidity ^0.8.2;


contract Array {

    uint[] private arr;
    uint[] private myArr = [1, 2, 3, 4];

    uint[10] private fixedSize;

    function addToArray(uint num) public {
        arr.push(num);
    }
    function getArr () public view returns (uint[] memory){
        return arr;
    }
    function pushIn() public {
        myArr.push(66);
    }
    function getMyArr() public view   returns (uint[] memory){
        return myArr;
    } 

    function pushIt() public {
        fixedSize[0] = 1;
        fixedSize[1] = 1;
        fixedSize[2] = 1;
        fixedSize[3] = 1;
        fixedSize[4] = 1;
        fixedSize[5] = 1;
        fixedSize[6] = 1;
        fixedSize[7] = 1;
        fixedSize[8] = 1;
        fixedSize[9] = 1;
    }

    function getFixedSize() public view returns (uint[10] memory){
        return fixedSize;
    }
}

